import axios from "axios";
import React from "react";

const dataurl = "http://192.168.7.132:8000/Turma/";


function Dados() {
    const [resp, setresp] = React.useState(null);
    axios.get(dataurl).then(resp => {
        console.log(resp.data);
       
    });

    
}

export default Dados;
